describe("Conflicting Options Tests",function(){var a;it("Should have the value zero when it is slided to zero",function(){a=$("#testSlider1").slider({value:0,step:1});var b=false;var c=document.createEvent("MouseEvents");a.on("slide",function(d){expect(d.value).toBe(0);b=true});a.data("slider")._mousemove(c);expect(b).toBeTruthy()});it("should set the `precision` to be the number of digits after the decimal of the `step` (assuming no `precision` is specified)",function(){a=$("#testSlider1").slider({value:8.115,step:0.01});var b=a.slider("getValue");expect(b).toBe(8.12)});it("should properly allow for a slider that has `range` set to true and `reversed` set to true",function(){a=new Slider("#testSlider1",{reversed:true,range:true,min:-5,max:20});a.setValue([-5,20]);var b=a.sliderElem.querySelector(".slider-selection").style.width;expect(b).toBe("100%");a.destroy();a=null});afterEach(function(){if(a){a.slider("destroy");a=null}})});